    [],nt"revision_timestamp": "2015-04-25T12:20:14.049527",nt"name": "stream-habitat-reach-summary-south-coast-ds768",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains in-stream salmonid
    habitat data summarized at the reach level. The data have been summarized from habitat
    unit level data collected by CDFW from November 2010 into September 2012. The database
    represents salmonid stream habitat surveys from 12 streams. Approximately 160 miles
    of streams were surveyed. The database helps identify and describe in-stream habitat
    available to anadromous salmonids within watersheds of the Santa Ynez hydrologic
    unit of the Central Coast Hydrologic Regions. Data were collected using standardized
    survey techniques according to the version of the "California Stream Habitat Restoration
    Manual" (see Flosi et al.) that was current in the year of survey. Field survey
    teams measured up to 60 parameters for selected habitat units. Stream surveys typically
    started at the downstream confluence and proceeded upstream to the "limit of anadromy"
    as assessed by the survey crew. WHAT EACH RECORD REPRESENTS Each record in this
    dataset represents in-stream habitat unit level data summarized at the stream reach
    level. A habitat unit is the base level for the stream habitat surveys and is generally
    determined by the occurrence of riffle, run and pool sections along the stream.
    Stream reaches are determined by changes in stream channel type as described by
    Rosgen (1994).",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
